INSERT INTO `stat` (`id_stat`, `head`, `short`, `poln`, `date`) VALUES
(3, 'РџСЂР°РІРёР»СЊРЅРѕ РѕС„РѕСЂРјР»СЏРµРј С‚РёС‚СѓР»СЊРЅС‹Р№ Р»РёСЃС‚ РєСѓСЂСЃРѕРІРѕР№', 'РџСЂР°РІРёР»СЊРЅРѕРµ РѕС„РѕСЂРјР»РµРЅРёРµ РєСѓСЂСЃРѕРІРѕР№ СЂР°Р±РѕС‚С‹ - РґРµР»Рѕ РЅРµ СЃР»РѕР¶РЅРѕРµ. РќРѕ РїСЂРёСЃС‚СѓРїР°СЏ Рє РѕС„РѕСЂРјР»РµРЅРёСЋ РєСѓСЂСЃРѕРІРѕР№, СЃР»РµРґСѓРµС‚ РїРѕРјРЅРёС‚СЊ: СЃСЂРµРґРё СЃС‚СѓРґРµРЅС‡РµСЃРєРёС… СЂР°Р±РѕС‚, РЅРµ РїСЂРёРЅСЏС‚С‹С… Рє СЂР°СЃСЃРјРѕС‚СЂРµРЅРёСЋ РёР»Рё Р·Р°С‰РёС‚Рµ, Р±РѕР»СЊС€РёРЅСЃС‚РІРѕ СЃРѕСЃС‚Р°РІР»СЏСЋС‚ РїР»РѕС…Рѕ РёР»Рё РЅРµРІРµСЂРЅРѕ РѕС„РѕСЂРјР»РµРЅРЅС‹Рµ РєСѓСЂСЃРѕРІС‹Рµ СЂР°Р±РѕС‚С‹. ', '<p>РџСЂР°РІРёР»СЊРЅРѕРµ РѕС„РѕСЂРјР»РµРЅРёРµ РєСѓСЂСЃРѕРІРѕР№ СЂР°Р±РѕС‚С‹ - РґРµР»Рѕ РЅРµ СЃР»РѕР¶РЅРѕРµ. РќРѕ РїСЂРёСЃС‚СѓРїР°СЏ Рє РѕС„РѕСЂРјР»РµРЅРёСЋ РєСѓСЂСЃРѕРІРѕР№, СЃР»РµРґСѓРµС‚ РїРѕРјРЅРёС‚СЊ: СЃСЂРµРґРё СЃС‚СѓРґРµРЅС‡РµСЃРєРёС… СЂР°Р±РѕС‚, РЅРµ РїСЂРёРЅСЏС‚С‹С… Рє СЂР°СЃСЃРјРѕС‚СЂРµРЅРёСЋ РёР»Рё Р·Р°С‰РёС‚Рµ, Р±РѕР»СЊС€РёРЅСЃС‚РІРѕ СЃРѕСЃС‚Р°РІР»СЏСЋС‚ РїР»РѕС…Рѕ РёР»Рё РЅРµРІРµСЂРЅРѕ РѕС„РѕСЂРјР»РµРЅРЅС‹Рµ РєСѓСЂСЃРѕРІС‹Рµ СЂР°Р±РѕС‚С‹. Р›РёРґРµСЂ СЃСЂРµРґРё РїСЂРёС‡РёРЅ РЅРµРіР°С‚РёРІРЅРѕР№ СЂРµР°РєС†РёРё РїСЂРµРїРѕРґР°РІР°С‚РµР»СЏ РЅР° СЃС‚СѓРґРµРЅС‡РµСЃРєСѓСЋ СЂР°Р±РѕС‚Сѓ - РЅРµРІРµСЂРЅРѕРµ РѕС„РѕСЂРјР»РµРЅРёРµ РєСѓСЂСЃРѕРІРѕР№ СЂР°Р±РѕС‚С‹.    <p>РњРЅРѕРіРёРµ Р’РЈР—С‹ РІС‹РїСѓСЃРєР°СЋС‚ РјРµС‚РѕРґРёС‡РµСЃРєРёРµ СѓРєР°Р·Р°РЅРёСЏ, СЃРѕРґРµСЂР¶Р°С‰РёРµ СЂРµРєРѕРјРµРЅРґР°С†РёРё РїРѕ РѕС„РѕСЂРјР»РµРЅРёСЋ РєСѓСЂСЃРѕРІС‹С… Рё РґРёРїР»РѕРјРЅС‹С… СЂР°Р±РѕС‚.     <p>Р•СЃР»Рё Р’С‹ СЂР°СЃРїРѕР»Р°РіР°РµС‚Рµ С‚Р°РєРѕР№ РјРµС‚РѕРґРёС‡РєРѕР№ - РѕС„РѕСЂРјР»РµРЅРёРµ РєСѓСЂСЃРѕРІРѕР№ СЃР»РµРґСѓРµС‚ РїСЂРѕРёР·РІРѕРґРёС‚СЊ РІ СЃРѕРѕС‚РІРµС‚СЃС‚РІРёРё СЃ СЂРµРєРѕРјРµРЅРґР°С†РёСЏРјРё РІ РЅРµР№ РёР·Р»РѕР¶РµРЅРЅС‹РјРё.    <p>Р•СЃР»Рё Р’С‹ РЅРµ СЂР°СЃРїРѕР»Р°РіР°РµС‚Рµ РјРµС‚РѕРґРёС‡РєРѕР№ СЃРІРѕРµРіРѕ Р’РЈР—Р° - РѕС„РѕСЂРјР»РµРЅРёРµ РєСѓСЂСЃРѕРІРѕР№ СЃР»РµРґСѓРµС‚ РїСЂРѕРёР·РІРѕРґРёС‚СЊ РІ СЃРѕРѕС‚РІРµС‚СЃС‚РІРёРё СЃ РїРѕР»РѕР¶РµРЅРёСЏРјРё Р“РћРЎРўРѕРІ.     <p>РќР° СЃРµРіРѕРґРЅСЏС€РЅРёР№ РґРµРЅСЊ РЅРµ СЃСѓС‰РµСЃС‚РІСѓРµС‚ РіРѕСЃСѓРґР°СЂСЃС‚РІРµРЅРЅС‹С… РЅРѕСЂРјР°С‚РёРІРЅС‹С… РґРѕРєСѓРјРµРЅС‚РѕРІ, РєРѕС‚РѕСЂС‹Рµ Р±С‹ СЃРїРµС†РёР°Р»СЊРЅРѕ СЂРµРіСѓР»РёСЂРѕРІР°Р»Рё РѕС„РѕСЂРјР»РµРЅРёРµ РєСѓСЂСЃРѕРІРѕР№, РёР»Рё Р»СЋР±РѕР№ РґСЂСѓРіРѕР№ РїРёСЃСЊРјРµРЅРЅРѕР№ СЃС‚СѓРґРµРЅС‡РµСЃРєРѕР№ СЂР°Р±РѕС‚С‹. РџРѕ СЃР»РѕР¶РёРІС€РµР№СЃСЏ РїСЂР°РєС‚РёРєРµ, СЂРµС„РµСЂР°С‚, РєСѓСЂСЃРѕРІР°СЏ, РґРёРїР»РѕРјРЅР°СЏ СЂР°Р±РѕС‚Р° СЂР°СЃСЃРјР°С‚СЂРёРІР°СЋС‚СЃСЏ РєР°Рє РЅР°СѓС‡РЅС‹Рµ СЂР°Р±РѕС‚С‹.     <p>Р’ СЌС‚РѕРј РєР°С‡РµСЃС‚РІРµ, РѕС„РѕСЂРјР»РµРЅРёРµ РєСѓСЂСЃРѕРІРѕР№ СЂР°Р±РѕС‚С‹ РїРѕРґРїР°РґР°РµС‚ РїРѕРґ РґРµР№СЃС‚РІРёРµ Р“РћРЎРў 7.32-2001 В«РћС‚С‡РµС‚ Рѕ РЅР°СѓС‡РЅРѕ-РёСЃСЃР»РµРґРѕРІР°С‚РµР»СЊСЃРєРѕР№ СЂР°Р±РѕС‚Рµ. РЎС‚СЂСѓРєС‚СѓСЂР° Рё РїСЂР°РІРёР»Р° РѕС„РѕСЂРјР»РµРЅРёСЏВ». Р’РЈР—С‹ РІ СЃРІРѕРёС… РјРµС‚РѕРґРёС‡РєР°С… РѕР±С‹С‡РЅРѕ С‚Р°Рє РёР»Рё РёРЅР°С‡Рµ СЃСЃС‹Р»Р°СЋС‚СЃСЏ РЅР° РґР°РЅРЅС‹Р№ Р“РћРЎРў. Р’РјРµСЃС‚Рµ СЃ С‚РµРј, Р“РћРЎРў 7.32-2001 РЅРµ СЂР°СЃРїСЂРѕСЃС‚СЂР°РЅСЏРµС‚СЃСЏ РЅР° РѕС‚С‡РµС‚С‹ Рѕ РЅР°СѓС‡РЅРѕ-РёСЃСЃР»РµРґРѕРІР°С‚РµР»СЊСЃРєРѕР№ СЂР°Р±РѕС‚Рµ РіСѓРјР°РЅРёС‚Р°СЂРЅРѕРіРѕ РїСЂРѕС„РёР»СЏ, Рє РєРѕС‚РѕСЂРѕРјСѓ РѕС‚РЅРѕСЃСЏС‚СЃСЏ РІСЃРµ СЂРµС„РµСЂР°С‚С‹, РєСѓСЂСЃРѕРІС‹Рµ Рё РґРёРїР»РѕРјС‹ СЃРёСЃС‚РµРјС‹ Р±РёР·РЅРµСЃ-РѕР±СЂР°Р·РѕРІР°РЅРёСЏ, РїСЃРёС…РѕР»РѕРіРёРё, СЃРѕС†РёРѕР»РѕРіРёРё Рё С‚.Рї. РћРґРЅР°РєРѕ РґСЂСѓРіРѕРіРѕ, Р±РѕР»РµРµ РїРѕРґС…РѕРґСЏС‰РµРіРѕ Р“РћРЎРўР° РїРѕ РѕС„РѕСЂРјР»РµРЅРёСЋ РЅРµ СЃСѓС‰РµСЃС‚РІСѓРµС‚, РїРѕСЌС‚РѕРјСѓ, РїСЂРё РѕС„РѕСЂРјР»РµРЅРёРё РєСѓСЂСЃРѕРІРѕР№ СЂР°Р±РѕС‚С‹ (СЂРµС„РµСЂР°С‚Р°, РґРёРїР»РѕРјРЅРѕР№ СЂР°Р±РѕС‚С‹), РЅРµРѕР±С…РѕРґРёРјРѕ РѕСЂРёРµРЅС‚РёСЂРѕРІР°С‚СЊСЃСЏ РЅР° СЌС‚РѕС‚ Р“РћРЎРў.    Р’СЃРµ Р°СЃРїРµРєС‚С‹ РѕС„РѕСЂРјР»РµРЅРёСЏ С‚РµРєСЃС‚РѕРІС‹С… РґРѕРєСѓРјРµРЅС‚РѕРІ Рё РѕС‚С‡РµС‚РѕРІ Рѕ РќРР  СЃРѕРґРµСЂР¶Р°С‚СЃСЏ РІ СЃР»РµРґСѓСЋС‰РёС… РґРѕРєСѓРјРµРЅС‚Р°С…:  <li>Р“РћРЎРў 7.32-2001 В«РћС‚С‡РµС‚ Рѕ РЅР°СѓС‡РЅРѕ-РёСЃСЃР»РµРґРѕРІР°С‚РµР»СЊСЃРєРѕР№ СЂР°Р±РѕС‚Рµ. РЎС‚СЂСѓРєС‚СѓСЂР° Рё РїСЂР°РІРёР»Р° РѕС„РѕСЂРјР»РµРЅРёСЏВ».   </li><li>Р“РћРЎРў 2.105-95 В«РћР±С‰РёРµ С‚СЂРµР±РѕРІР°РЅРёСЏ Рє С‚РµРєСЃС‚РѕРІС‹Рј РґРѕРєСѓРјРµРЅС‚Р°РјВ»   </li><li>Р“РћРЎРў Р  7.0.5-2008 В«Р‘РёР±Р»РёРѕРіСЂР°С„РёС‡РµСЃРєР°СЏ СЃСЃС‹Р»РєР°. РћР±С‰РёРµ С‚СЂРµР±РѕРІР°РЅРёСЏ Рё РїСЂР°РІРёР»Р° СЃРѕСЃС‚Р°РІР»РµРЅРёСЏВ»   Р“РћРЎРў 7.', '2013-02-11');
