(85, 0, 2, 'СЌРєРѕР»РѕРіРёС‡РµСЃРєРѕРµ РїСЂР°РІРѕ', 0, 'РџСЂР°РІРѕРІРѕР№ СЂРµР¶РёРј Р·РѕРЅ С‡СЂРµР·РІС‹С‡Р°Р№РЅРѕР№ СЌРєРѕР»РѕРіРёС‡РµСЃРєРѕР№ СЃРёС‚СѓР°С†РёРё Рё Р·РѕРЅ СЌРєРѕР»РѕРіРёС‡РµСЃРєРѕРіРѕ Р±РµРґСЃС‚РІРёСЏ ', 13, 15, '2013-04-17', '', 1, '', '', '0000-00-00 00:00:00', '2013-04-14 22:42:49', '0000-00-00 00:00:00', '\r\n\r\nРџСЂРёРјРµСЂРЅС‹Р№ РїР»Р°РЅ:\r\nР’РІРµРґРµРЅРёРµ\r\n1. РџРѕРЅСЏС‚РёРµ РїСЂР°РІРѕРІРѕРіРѕ СЂРµР¶РёРјР° Р·РѕРЅ С‡СЂРµР·РІС‹С‡Р°Р№РЅРѕР№ СЌРєРѕР»РѕРіРёС‡РµСЃРєРѕР№ СЃРёС‚СѓР°С†РёРё. \r\n2. РћСЃРЅРѕРІРЅС‹Рµ РєСЂРёС‚РµСЂРёРё Р·РѕРЅ С‡СЂРµР·РІС‹С‡Р°Р№РЅРѕР№ СЌРєРѕР»РѕРіРёС‡РµСЃРєРѕР№ СЃРёС‚СѓР°С†РёРё. \r\n3. РњРµСЂРѕРїСЂРёСЏС‚РёСЏ, РїСЂРѕРІРѕРґРёРјС‹Рµ РІ СЃРІСЏР·Рё СЃ Р»РёРєРІРёРґР°С†РёРµР№ СЌРєРѕР»РѕРіРёС‡РµСЃРєРёС… РїРѕСЃР»РµРґСЃС‚РІРёР№ РІ Р·РѕРЅРµ С‡СЂРµР·РІС‹С‡Р°Р№РЅРѕРіРѕ СЌРєРѕР»РѕРіРёС‡РµСЃРєРѕРіРѕ Р±РµРґСЃС‚РІРёСЏ. \r\n4. РћСЃРѕР±РµРЅРЅРѕСЃС‚Рё РїСЂР°РІРѕРІРѕРіРѕ СЂРµР¶РёРјР° Р·РѕРЅ СЌРєРѕР»РѕРіРёС‡РµСЃРєРѕРіРѕ Р±РµРґСЃС‚РІРёСЏ. \r\n5. РћС‚РІРµС‚СЃС‚РІРµРЅРЅРѕСЃС‚СЊ Р»РёС†, РЅР°СЂСѓС€Р°СЋС‰РёС… СЌРєРѕР»РѕРіРёС‡РµСЃРєРѕРµ Р·Р°РєРѕРЅРѕРґР°С‚РµР»СЊСЃС‚РІРѕ РІ Р·РѕРЅРµ С‡СЂРµР·РІС‹С‡Р°Р№РЅРѕР№ СЌРєРѕР»РѕРіРёС‡РµСЃРєРѕР№ СЃРёС‚СѓР°С†РёРё\r\nР—Р°РєР»СЋС‡РµРЅРёРµ\r\n', '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', 20, 2000, 5, 'ksushka-92@bk.ru'),
